            if v1[i] > v2[i]:
                return 1
            elif v1[i] < v2[i]:
                return -1
        return 0

def dfs(node, visited, adj, k, min_val):
    visited[node] = True
    if k == 0:
        return min_val
    for neighbor in adj[node]:
        if not visited[neighbor]:
            min_val = min(min_val, dfs(neighbor, visited, adj, k-1, min_val))
    return min_val


