class Solution:
    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        if not nums:
            return []
        if len(nums) == 1:
            return nums
        if len(nums) == 2:
            if nums[0] == nums[1]:
                return nums
            else:
                return [nums[0], nums[1]]
        if len(nums) == 3:
            if nums[0] == nums[1]:
                return [nums[0]]
            elif nums[1] == nums[2]:
                return [nums[1]]
            elif nums[0] == nums[2]:
                return [nums[0]]
            else:
                return [nums[0], nums[1]]

        nums.sort()
        count = 1
        result = []
        for i in range(1, len(nums)):
            if nums[i] == nums[i-1]:
                count += 1
            else:
                if count > len(nums)/3:
                    result.append(nums[i-1])
                count = 1
        if count > len(nums)/3:
            result.append(nums[-1])
        return result

