def reverse(a, l, r):
    while l < r:
        a[l], a[r] = a[r], a[l]
        l += 1
        r -= 1


def swap(a, l, r):
    while l < r:
        a[l], a[r] = a[r], a[l]
        l += 2
        r -= 2


def sum(a, l, r):
    s = 0
    while l <= r:
        s += a[l]
        l += 1
    return s


def build(a, b, l, r):
    if l == r:
        b[l] = a[l]
        return
    m = (l + r) // 2
    build(a, b, l, m)
    build(a, b, m + 1, r)
    b[l] = b[l * 2] + b[l * 2 + 1]


def update(a, b, l, r, x, k):
    if l == r:
        b[l] = k
        return
    m = (l + r) // 2
    if x <= m:
        update(a, b, l, m, x, k)
    else:
        update(a, b, m + 1, r, x, k)
    b[l] = b[l * 2] + b[l * 2 + 1]


