from collections import defaultdict


def dfs(node, visited, graph, path):
    visited[node] = True
    path.append(node)
    for neighbor in graph[node]:
        if not visited[neighbor]:
            dfs(neighbor, visited, graph, path)


def find_path(graph, start, end):
    visited = defaultdict(bool)
    path = []
    dfs(start, visited, graph, path)
    if end in path:
        return path[path.index(end):]
    else:
        return []


def find_playlist(graph, n):
    playlist = []
    visited = defaultdict(bool)
    for node in range(1, n+1):
        if not visited[node]:
