def check(word1, word2):
    count = 0
    for i in range(len(word1)):
        if word1[i] != word2[i]:
            count += 1
    return count


def bfs(start, end, words):
    queue = [start]
    visited = set()
    visited.add(start)
    steps = 0
    while queue:
        size = len(queue)
        for i in range(size):
            word = queue.pop(0)
            if word == end:
                return steps
            for word2 in words:
                if word2 not in visited and check(word, word2) == 1:
                    queue.append(word2)
                    visited.add(word2)
        steps += 1
    return -1


