def clean_line(line):
    line = line.strip()
    line = ' '.join(line.split())
    return line


def clean_lines(lines):
    return [clean_line(line) for line in lines]


def match_lines(lines1, lines2):
    lines1 = clean_lines(lines1)
    lines2 = clean_lines(lines2)
    max_match = 0
    for i in range(len(lines1)):
        match = 0
        for j in range(len(lines2)):
            if lines1[i+j] == lines2[j]:
                match += 1
                max_match = max(max_match, match)
            else:
                match = 0
    return max_match


def match_code(code, fragments):
    max_match = 0
    for fragment in fragments:
        match = match_lines(code, fragment)
        if match > max_match:
            max_match = match
    return max_match


