def f(x, y):
    if x == 0 and y == 0:
        return 1
    if x < 0 or y < 0:
        return 0
    if (x, y) in memo:
        return memo[(x, y)]
    memo[(x, y)] = f(x-1, y) + f(x, y-1)
    return memo[(x, y)]


